import { NavLink } from "react-router-dom"


function MainNavigation() {
  return (
    <div>
        <NavLink className={({isActive}) => isActive ? "active" : undefined} to="/">Home</NavLink>
        <NavLink className={({isActive}) => isActive ? "active" : undefined} to="/events"><button>Events Page</button></NavLink>
        <NavLink className={({isActive}) => isActive ? "active" : undefined} to="/events/new"><button>New Event</button></NavLink>
    </div>
  )
}

export default MainNavigation
